properties.property:
EVENTSTART
Name:Check
SCRIPTSTART
var face1= presenter.playerController.getModule('Image1');
var LC1values = presenter.playerController.getModule('Limited_Check1').getModulesScore();

var maxScore = LC1values.maxScore;
var score = LC1values.score;
var errors = LC1values.errors;

var AudioWrong = presenter.playerController.getModule('AudioWrong');
var AudioAward= presenter.playerController.getModule('AudioAward');


if(score==maxScore && errors==0 ){

AudioWrong.stop();
AudioAward.stop();
AudioAward.play();
face1.show();

} 
else if(score<=maxScore && errors!=0) {
AudioWrong.stop();
AudioAward.stop();
AudioWrong.play();
face1.hide();

}

else if(score<=maxScore && errors==0) {
AudioWrong.stop();
AudioAward.stop();
face1.hide();
}

SCRIPTEND
EVENTEND
